import React,{useState} from "react";
import '../styles/Formm.css';

const getLocation=()=>{
  navigator.geolocation.getCurrentPosition((position)=>{
    console.log(position);
    var {latitude}=position.coords;
    var {longitude}=position.coords;
    console.log(latitude,longitude);
  },()=>{
    alert("could not get your postion");
  })
}
const  Myform=()=>{
  
    const [personid,setpersonid]=useState(0);
    const [name,setName]=useState("");
    const [email,setEmail]=useState("");
    const [aspect ,setAspect]=useState("");
    const [phone ,setPhone]=useState(0); 
    const [location,setLocation]=useState(""); 
    const [east,setEast]=useState(0);
    const [north,setNorth]=useState(0);
    const [ownership,setOwnership]=useState("");
    const [purpose,setrPurpose]=useState("");
    const [specie,setSpecie]=("");
    const [spacing,setSpacing]=useState(0);
    const [survivalrate,setSurvivalRate]=useState(0);
    const [suggestions,setSuggestions]=useState("");
    const [date,setDate]=useState(0);
    const [pic,setPic]=useState();
    const display=()=>{
      console.log(name,location,east,north,ownership,purpose,spacing,email,aspect);
    }
      return (
        <div className="Form">
          <div className="testbox">
          <form action="#">
            <div className="banner">
              <h1 className='header'>Performa for Agroforestry and Farm Forestry</h1>
            </div>
            <div className="item">
              <p>Location</p>
              <div className="name-item">
                <input className="input" type="text" name="location"
                onChange={(event)=>{
                  setLocation(event.target.value);
                }} 
                placeholder="Location" required/>
              </div>
            </div>
            <div className="item">
                <p>Name:</p>
                <div className="name-item">
                  <input type="text" className="input" name="Name"
                  onChange={(event)=>{
                    setName(event.target.value);
                  }}
                  placeholder="Enter name" required/>
              </div>
            </div>
            <div className="item">
              <p>Email</p>
              <input type="email" className="input" name="Email" 
              onChange={(event)=>{
                setEmail(event.target.value);
              }}
              placeholder='email' required/>
            </div>
            <div className="item">
              <p>Phone</p>
              <input type="text" name="Phone" 
              onChange={(event)=>{
                setPhone(event.target.value);
              }}
              placeholder="92 333000000" required/>
            </div>
            <div className="item">
              <p>GPS Coordinates:</p>
              <button onClick={getLocation()}>Location</button>
            </div>
            <div className="item">
              <p>Aspect:</p>
              <input type="text" className="input" name="Aspect" 
              onChange={(event)=>{
                setAspect(event.target.value);
              }}
              placeholder='Aspect' required/>
            </div>
            <div className="question">
              <p>OwnerShip:</p>
              <div className="question-answer">
                <div>
                  <input className="radio" type="radio" name="OwnerShip"
                  onChange={(event)=>{
                    setOwnership(event.target.value);
                  }}
                  required/>
                  <label htmlFor="radio" className="radio1"><span>Community</span></label>
                </div>
                <div>
                  <input type="radio" name="OwnerShip"
                  onChange={(event)=>{
                    setOwnership(event.target.value);
                  }}
                  required/>
                  <label htmlFor="radio" className="radio2"><span>Individual</span></label>
                </div>
              </div>
            </div>
            <div className="question">
              <p>Purpose of AF/FF:</p>
              <div className="question-answer">
                <div>
                  <input type="radio"  name="PurposeOfAP_FF"
                  onChange={(event)=>{
                    setrPurpose(event.target.value);
                  }}
                  id="radio_4" required/>
                  <label htmlFor="radio_4"  className="radio3"><span>Fuel Wood</span></label>
                </div>
                <div>
                  <input type="radio"  name="PurposeOfAP_FF"
                   onChange={(event)=>{
                    setrPurpose(event.target.value);
                  }}
                  id="radio_5" required/>
                  <label htmlFor="radio_5" className="radio4"><span>Fodder</span></label>
                </div>
                <div className="timber">
                  <input type="radio" name="PurposeOfAP_FF"
                   onChange={(event)=>{
                    setrPurpose(event.target.value);
                  }}
                  id="radio_6" required/>
                  <label htmlFor="radio_6" className="radio5"><span>Timber</span></label>
                </div>
                <div className="others">
                    <label ><span>Other(please specify)</span></label>
                    <input type="text" className="input1" id="radio_6" name="PurposeOfAP_FF"
                     onChange={(event)=>{
                      setrPurpose(event.target.value);
                    }}
                    required/>
                </div>
                <div className="item">
                    <p>Species Of Plants Provided:</p>
                    <input type="text" className="input" name="species" 
                    onChange={(event)=>{
                      setSpecie(event.target.value);
                    }}
                    required/>
                </div>
                <div className="item">
                    <p>Spacing:</p>
                    <input type="text" className="input" name="Spacing" 
                    onChange={(event)=>{
                      setSpacing(event.target.value);
                    }}
                     required/>
                </div>
                <div className="item">
                    <p>Survival Rate:</p>
                    <input type="text" className="input" name="Survival Rate" 
                    onChange={(event)=>{
                      setSurvivalRate(event.target.value);
                    }}
                     required/>
                </div>
                <div className="item">
                    <p>Suggestions:</p>
                    <input type="text" className="input" name="Suggestions" 
                    onChange={(event)=>{
                      setSuggestions(event.target.value);
                    }}
                    required/>
                </div>
              </div>
            </div>
            <div className="item1">
                <p>Date of Planting:</p>
                <input type="date"
                onChange={(event)=>{
                  setDate(event.target.value);
                }}
                name="date" required/>
                <i className="fas fa-calendar-alt"></i>
            </div>
            <div >
                <input  type="file" className="input"
                onChange={(event)=>{
                  setPic(event.target.value);
                }}
                name="bdate" />
                <i className="fas fa-calendar-alt"></i>
            </div>
            <div className="btn-block btn">
              <button type="submit" href="" onClick={display }>Submit</button>
            </div>
          </form>
        </div>
        </div>
      );

}
